script: |
  super -f text -I q5699.spq | sort > q5699.out

inputs:
  - name: q5699.spq
    data: |
      SELECT DISTINCT - + col0 + - + col1 AS col1, - 82 FROM tab2 (FORMAT parquet) cor0 WHERE CAST ( - 8 AS INTEGER ) IN ( + col2, + col2 * + + col2, + - 73 );
  - name: tab2

outputs:
  - name: q5699.out
    data: |
